import CheckBox from 'react-native-check-box';
import React, { useState, useEffect, useRef } from 'react';
import NumericInput from '@wwdrew/react-native-numeric-textinput';
import { SendForm, queryFormUsers, updateForms, gravarLogLocal } from '../businessLayer/forms';
import { routes } from '../utils/constants';
import { Text, View, Button, Alert, TextInput, Picker, ScrollView, KeyboardAvoidingView, TouchableOpacity } from 'react-native';
import RadioForm from 'react-native-simple-radio-button';
import DatePicker from 'react-native-datepicker';
import TimePicker from 'react-native-simple-time-picker';
import { styles } from '../styles/styles';
import Autocomplete from 'react-native-autocomplete-input';
import Moment from 'moment';
import { ButtonP, ButtonG } from '../components/Button';
import { deleteFormByRoute } from '../db/forms';

export default function DadosMecanica(props) {
	const [defaultForm, setDefaultForm] = useState(undefined);
	const [createdForm, setCreatedForm] = useState(undefined);
	const [resultQuery1, setResultQuery1] = useState([]);
	const [queryDados1, setQueryDados1] = useState('');
	const [resultQuery2, setResultQuery2] = useState([]);
	const [queryDados2, setQueryDados2] = useState('');

	const [dateSelect, setDateSelect] = useState({
		date1: Moment(new Date()).format('DD/MM/YYYY'),
		date2: Moment(new Date()).format('DD/MM/YYYY'),
		selectedHours2: 0,
		selectedMinutes2: 0
	});

	const [dadosForm, setDadosForm] = useState({
		idBoletim: '',
		investigador1: '',
		investigador2: '',
		idInvestigador1: 0,
		idInvestigador2: 0,
		dataInspecao: dateSelect.date2 + ' ' + dateSelect.selectedHours2 + ':' + dateSelect.selectedMinutes2,
		descricao: '',
		subidaFriso: false,
		aberturaBitola: false,
		objetosEstranhos: false,
		elevacaoRoda: false,
		fraturaTrilho: false,
		observacoesMecanicaDescarrilamento: '',
		pesoBruto: '0.00',
		pesoPorEixo: '0.00',
		vazioCarregadoMisto: 'V',
		latDesnivExcCarga: 'Lat.Desniveladas',
		cabDesnivNormal: 'Cab.Desniveladas',
		vagao: '',
		posicaoTrem: '',
		cabeceiraAFrente: 'A',
		ultimaRevisao: dateSelect.date1,
		vagaoReincidente: false,
		observacaoPVD: '',
		primeiroTruque: true,
		frente: false,
		primeiraRoda: 'RD1',
		primeiraRodaStatus: 'Nova',
		primeiraRodaStatusOutra: '',
		travessaTruque: 'Boa',
		travessaTruqueOutra: '',
		travessaPrato: 'Boa',
		travessaPratoOutra: '',
		rodasConcavas: false,
		tipoTruque: 'métrica',
		pesoAntecede: '0.00',
		lotacaoAntecede: '0.00',
		pesoBrutoAntecede: '0.00',
		alturaAntecede: '',
		pesoDescarrilou: '0.00',
		lotacaoDescarrilou: '0.00',
		pesoBrutoDescarrilou: '0.00',
		alturaDescarrilouCA: '',
		alturaDescarrilouCB: '',
		pesoPost: '0.00',
		lotacaoPost: '0.00',
		pesoBrutoPost: '0.00',
		alturaPost: '',
		contatoBatentes: false,
		contatoBatentesObs: '',
		diferencaAltura: false,
		diferencaAlturaObs: '',
		contatoIrregular: false,
		contatoIrregularObs: '',
		vagaoIsolado: false,
		torneiraAngular: false,
		irregularidadeTorneiraAngular: false,
		irregularidadePistao: false,
		vagoesIsolados: '',
		emBlocos: false,
		obsSisFreios: '',
		custosMateriais: '0.00',
		custosDeslocamentoEstadia: '0.00',
		custosPessoal: '0.00',
		custosTotal: '0.00',
		altFrisoAE4: '',
		espFrisoAE4: '',
		altBandAE4: '',
		altCunhaFricAE4: '',
		altCunhaFricAE4Tipo: '',
		concavidadeDaRodaE4: '',
		altFrisoAE3: '',
		espFrisoAE3: '',
		altBandAE3: '',
		altCunhaFricAE3: '',
		altCunhaFricAE3Tipo: '',
		concavidadeDaRodaE3: '',
		altFrisoAE2: '',
		espFrisoAE2: '',
		altBandAE2: '',
		altCunhaFricAE2: '',
		altCunhaFricAE2Tipo: '',
		concavidadeDaRodaE2: '',
		altFrisoAE1: '',
		espFrisoAE1: '',
		altBandAE1: '',
		altCunhaFricAE1: '',
		altCunhaFricAE1Tipo: '',
		concavidadeDaRodaE1: '',
		altFrisoAD4: '',
		espFrisoAD4: '',
		altBandAD4: '',
		altCunhaFricAD4: '',
		altCunhaFricAD4Tipo: '',
		concavidadeDaRodaD4: '',
